import React from 'react';

const Navigation = () => {
    return (
        <div>
            <header c="bg-white black-80 tc pv4 avenir">
                <a href="" c="bg-black-80 ba b--black dib pa3 w2 h2 br-100">
                    <svg c="white" data-icon="skull" viewBox="0 0 32 32" style="fill:currentcolor"><title>skull icon</title><path d="M16 0 C6 0 2 4 2 14 L2 22 L6 24 L6 30 L26 30 L26 24 L30 22 L30 14 C30 4 26 0 16 0 M9 12 A4.5 4.5 0 0 1 9 21 A4.5 4.5 0 0 1 9 12 M23 12 A4.5 4.5 0 0 1 23 21 A4.5 4.5 0 0 1 23 12"></path></svg>
                </a>
                <h1 c="mt2 mb0 baskerville i fw1 f1">Title</h1>
                <h2 c="mt2 mb0 f6 fw4 ttu tracked">Your amazing subtitle</h2>
                <nav c="bt bb tc mw7 center mt4">
                    <a c="f6 f5-l link bg-animate black-80 hover-bg-lightest-blue dib pa3 ph4-l" href="/">Home</a>
                    <a c="f6 f5-l link bg-animate black-80 hover-bg-light-green dib pa3 ph4-l" href="/portfolio">Portfolio</a>
                    <a c="f6 f5-l link bg-animate black-80 hover-bg-light-blue dib pa3 ph4-l" href="/shop">Shop</a>
                    <a c="f6 f5-l link bg-animate black-80 hover-bg-light-pink dib pa3 ph4-l" href="/about">About</a>
                    <a c="f6 f5-l link bg-animate black-80 hover-bg-light-yellow dib pa3 ph4-l" href="/contact">Contact</a>
                </nav>
            </header>

        </div>
    );

}

export default Navigation;
